import React from "react";
import "./Header.scss";
import { Link } from "react-router-dom";

function Header() {
  return (
    <section className="nav-bar">
      <nav className="nav">
        <h1>metaSHOP</h1>
        <div className="nav__user">
          <Link to="/users" className="nav__user--link">
            SIGN UP
          </Link>
          <Link to="/users/login" className="nav__user--link">
            SIGN IN
          </Link>
        </div>
      </nav>
    </section>
  );
}

export default Header;
